#if !defined(BRAND_LIB)

double      brand               ();
void        bseed               (int seed);
void        brefresh            (int seed);

#define BRAND_LIB
#endif

/** Returns a random floating point variable between 0 and 1. */
double brand() {
    current_index_random = (current_index_random + 1) % 10000;
    return random_points[current_index_random];
}

/** Sets the seed, highly recommended. */
void bseed(int seed) {
    current_index_random = seed % 10000;
}

/** Changes all of the random values brand can return depending on the seed. */
void brefresh(int seed) {
    int mod = (seed*seed)% 10000;
    double m = mod / 10000.0;

    for (int i = 0; i < 10000;i++) {
        random_points[i] = random_points[i] + m;
        if (random_points[i] > 1) random_points[i] = random_points[i] - 1;
        if (random_points[i] < 0) random_points[i] = random_points[i] + 1;
    }

}